import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

import "./routesCss/Home.css";

const Home = () => {
	return (
		<>
			<Navbar />
			<div className="homeContainer">
				<div className="homeBanner"></div>
			</div>

			<Footer />
		</>
	);
};

export default Home;
